export default function Profile (props) {

    return (
        <View>
            <TextInput onChangeText={setUsername} />
            <Text>{username}</Text>
            <Button buttonStyle={styles.buttons}
            title="Home"
            onPress={() => props.navigation.navigate("Home")} /> 
